import torch
import torch.nn as nn

class ConvBlock(nn.Module):
    def __init__(self, in_channels, out_channels, kernel_size=3, stride=1, padding=1):
        super(ConvBlock, self).__init__()
        self.conv = nn.Conv2d(in_channels, out_channels, kernel_size, stride, padding)
        self.bn = nn.BatchNorm2d(out_channels)
        self.relu = nn.ReLU()

    def forward(self, x):
        return self.relu(self.bn(self.conv(x)))

class ELANBlock(nn.Module):
    def __init__(self, in_channels, out_channels):
        super(ELANBlock, self).__init__()
        self.conv1 = ConvBlock(in_channels, out_channels // 2, kernel_size=1, stride=1, padding=0)
        self.conv2 = ConvBlock(in_channels, out_channels // 2, kernel_size=1, stride=1, padding=0)
        self.conv3 = ConvBlock(out_channels // 2, out_channels // 4, kernel_size=3, stride=1, padding=1)
        self.conv4 = ConvBlock(out_channels // 2, out_channels // 4, kernel_size=3, stride=1, padding=1)

    def forward(self, x):
        x1 = self.conv1(x)
        x2 = self.conv2(x)
        x3 = self.conv3(x1)
        x4 = self.conv4(x2)
        return torch.cat([x1, x2, x3, x4], dim=1)

"""## Backbone YOLOv9


"""

class Backbone(nn.Module):
    def __init__(self):
        super(Backbone, self).__init__()
        self.conv1 = ConvBlock(3, 64, kernel_size=3, stride=1, padding=1)
        self.elan1 = ELANBlock(64, 128)
        self.transition1 = ConvBlock(128, 256, kernel_size=3, stride=2, padding=1)
        self.elan2 = ELANBlock(256, 512)
        self.transition2 = ConvBlock(512, 1024, kernel_size=3, stride=2, padding=1)
        self.elan3 = ELANBlock(1024, 1024)

    def forward(self, x):
        x = self.conv1(x)
        c3 = self.elan1(x)
        c4 = self.transition1(c3)
        c5 = self.elan2(c4)
        c6 = self.transition2(c5)
        c7 = self.elan3(c6)
        return c3, c4, c5, c6, c7

"""## Neck YOLOV9"""

class PANet(nn.Module):
    def __init__(self):
        super(PANet, self).__init__()
        self.conv1 = ConvBlock(1024, 512, kernel_size=1, stride=1, padding=0)
        self.upsample1 = nn.Upsample(scale_factor=2, mode='nearest')
        self.conv2 = ConvBlock(1024, 512, kernel_size=1, stride=1, padding=0)

        self.conv3 = ConvBlock(512, 256, kernel_size=1, stride=1, padding=0)
        self.upsample2 = nn.Upsample(scale_factor=2, mode='nearest')
        self.conv4 = ConvBlock(512, 256, kernel_size=1, stride=1, padding=0)

        self.conv5 = ConvBlock(256, 128, kernel_size=1, stride=1, padding=0)

    def forward(self, c3, c4, c5, c6, c7):
        p5 = self.conv1(c7)
        up5 = self.upsample1(p5)
        p4 = self.conv2(torch.cat([up5, c6], dim=1))

        p3 = self.conv3(p4)
        up3 = self.upsample2(p3)
        p2 = self.conv4(torch.cat([up3, c5], dim=1))

        p1 = self.conv5(p2)
        return p1, p2, p3, p4, p5

"""## Head YOLOV9"""

class YOLOv9Head(nn.Module):
    def __init__(self, num_classes):
        super(YOLOv9Head, self).__init__()
        self.conv1 = nn.Conv2d(128, num_classes + 5, kernel_size=1, stride=1, padding=0)
        self.conv2 = nn.Conv2d(256, num_classes + 5, kernel_size=1, stride=1, padding=0)
        self.conv3 = nn.Conv2d(512, num_classes + 5, kernel_size=1, stride=1, padding=0)
        self.conv4 = nn.Conv2d(512, num_classes + 5, kernel_size=1, stride=1, padding=0)
        self.conv5 = nn.Conv2d(1024, num_classes + 5, kernel_size=1, stride=1, padding=0)

    def forward(self, p1, p2, p3, p4, p5):
        out1 = self.conv1(p1)
        out2 = self.conv2(p2)
        out3 = self.conv3(p3)
        out4 = self.conv4(p4)
        out5 = self.conv5(p5)
        return out1, out2, out3, out4, out5

"""## Global implementation"""

class YOLOv9(nn.Module):
    def __init__(self, num_classes=80):
        super(YOLOv9, self).__init__()
        self.backbone = Backbone()
        self.neck = PANet()
        self.head = YOLOv9Head(num_classes)

    def forward(self, x):
        c3, c4, c5, c6, c7 = self.backbone(x)
        p1, p2, p3, p4, p5 = self.neck(c3, c4, c5, c6, c7)
        out1, out2, out3, out4, out5 = self.head(p1, p2, p3, p4, p5)
        return out1, out2, out3, out4, out5

"""## Entrenamiento y evaluacin del modelo
### Etnrenamiento
"""

import torch.optim as optim
from torchvision import datasets, transforms

# Definir las transformaciones para los datos
transform = transforms.Compose([
    transforms.Resize((224, 224)),
    transforms.ToTensor(),
])

# Cargar el conjunto de datos
train_dataset = datasets.CIFAR10(root='./data', train=True, download=True, transform=transform)
train_loader = torch.utils.data.DataLoader(train_dataset, batch_size=64, shuffle=True)

# Definir el modelo, la funcin de prdida y el optimizador
model = YOLOv9(num_classes=10)
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=0.001)

# Entrenar el modelo
num_epochs = 10
for epoch in range(num_epochs):
    model.train()
    running_loss = 0.0
    for inputs, labels in train_loader:
        optimizer.zero_grad()
        outputs = model(inputs)
        loss = criterion(outputs, labels)
        loss.backward()
        optimizer.step()
        running_loss += loss.item()
    print(f"Epoch [{epoch+1}/{num_epochs}], Loss: {running_loss/len(train_loader):.4f}")

"""# Evaluacin"""

# Cargar el conjunto de datos de prueba
test_dataset = datasets.CIFAR10(root='./data', train=False, download=True, transform=transform)
test_loader = torch.utils.data.DataLoader(test_dataset, batch_size=64, shuffle=False)

# Evaluar el modelo
model.eval()
correct = 0
total = 0
with torch.no_grad():
    for inputs, labels in test_loader:
        outputs = model(inputs)
        _, predicted = torch.max(outputs.data, 1)
        total += labels.size(0)
        correct += (predicted == labels).sum().item()

print(f"Accuracy: {100 * correct / total:.2f}%")